    false,nt"url": null,nt"notes": "This narrative report for Kenai National
    Moose Range outlines Refuge accomplishments from January through April of 1959.
    The report begins by summarizing the weather conditions and habitat conditions during
    this period. Wildlife- including migratory birds, big game animals, raptors, and
    fish- is also covered. The Refuge development and maintenance section discusses
    collections and receipts and vegetation control. Resource management is outlined;
    topics include fur harvesting and timber removal. The public relations section of
    the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
